import React, { useState, useEffect } from 'react';
import './MakeYourOwn3.css';
import logo from './LOGO.jpg';
import confetti from './confetti.gif';//Adjust the path to your confetti GIF
import background from './bg-img.png';
import { jsPDF } from 'jspdf';

function MCQ() {
  const backgroundStyle = {
    backgroundImage: `url(${background})`,
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    height: '100vh',
    width: '100%',
  };
  
  const [questions, setQuestions] = useState([]);
  const [questionInput, setQuestionInput] = useState('');
  const [option1Input, setOption1Input] = useState('');
  const [option2Input, setOption2Input] = useState('');
  const [option3Input, setOption3Input] = useState('');
  const [correctAnswerInput, setCorrectAnswerInput] = useState('');
  const [showQuiz, setShowQuiz] = useState(false);
  const [currentQuestionIndex, setCurrentQuestionIndex] = useState(0);
  const [userAnswer, setUserAnswer] = useState('');
  const [score, setScore] = useState(0);
  const [resultMessage, setResultMessage] = useState('');
  const [showResult, setShowResult] = useState(false);
  const [quizFinished, setQuizFinished] = useState(false);
  const [elementColor, setElementColor] = useState('white'); // Initial color
  const[showConfetti, setShowConfetti] = useState(false)
  const [showform, setForm] = useState(false);
  const [email, setEmail] = useState('');

  const handleButtonClick = () => {
    setForm(!showform);
  }

  const cancel = () => {
    setForm(false);
  }

  const handleInputChange = (e) => {
    setEmail(e.target.value);
  }
  
  const verify = (event) => {
    event.preventDefault();

    const storedUser = JSON.parse(localStorage.getItem(email));

    console.log(storedUser);

    if (storedUser) 
    {
      const doc = new jsPDF();

      const pageWidth = doc.internal.pageSize.getWidth();
      const pageHeight = doc.internal.pageSize.getHeight();

      const marginLeft = 20;
      const marginTop = 20;
      const marginRight = pageWidth - 20;
      const marginBottom = pageHeight - 20;

      const margin = 10;
      doc.rect(margin, margin, pageWidth - 2 * margin, pageHeight - 2 * margin);

      let y = marginTop;

      for (let i = 0; i < questions.length; i++) {
        const questionX = marginLeft;
        const answerX = marginLeft;
        const optionsX = marginLeft + 10;
      
        doc.setFontSize(14);
        doc.setFont('Helvetica');
      
        // Question text
        const Q = `Q${i + 1}: ${questions[i].question}`;
        const qWidth = marginRight - marginLeft;
        const question = doc.splitTextToSize(Q, qWidth);
        doc.text(question, questionX, y);
      
        y += 10;
      
        // Options text
        const options = questions[i].options;
        options.forEach((option, index) => {
          const optionText = `${String.fromCharCode(65 + index)}. ${option}`; // A, B, C...
          const optionWidth = marginRight - optionsX;
          const optionLine = doc.splitTextToSize(optionText, optionWidth);
          doc.text(optionLine, optionsX, y);
      
          y += 8; // Slightly smaller spacing between options
        });
      
        // Correct answer
        const correctAnswer = `Correct Answer: ${questions[i].answer}`;
        const answerWidth = marginRight - marginLeft;
        const correctAnswerText = doc.splitTextToSize(correctAnswer, answerWidth);
        doc.text(correctAnswerText, answerX, y);
      
        y += 15;
      
        // Page break if necessary
        if (y > marginBottom - 20) {
          doc.addPage();
          y = marginTop;
          doc.rect(marginLeft, marginTop, marginRight - marginLeft, marginBottom);
        }
      }

      const totalPages = doc.getNumberOfPages();
      for (let i = 1; i <= totalPages; i++) {
        doc.setFontSize(100);
        doc.setTextColor(240, 240, 240); 
        const adjustedX = pageWidth / 2 + 30; 
        const adjustedY = pageHeight / 2 + 40;

        doc.text('FLASHX3', adjustedX, adjustedY, {
          angle: 45, 
          align: 'center', 
          baseline: 'middle' 
        });

        const footer = 'data:image/jpeg;base64,'

        const ImgWidth = 30;
          const ImgHeight = 20;

          const x = pageWidth - ImgWidth - 10;
          const y = pageHeight - ImgHeight - 10;

          doc.addImage(footer, 'JPEG', x, y, ImgWidth, ImgHeight);
        }
        doc.save('flashcard.pdf');

        setForm(false);
        alert("\nDocument successfully downloaded!\n");

      } 
      else 
      {
        alert("Signup to download the file!\nPlease note: On exiting the page the bullet points shall not be retained");
      }
    }
  const handleAddQuestion = () => {
    if (
      questionInput &&
      option1Input &&
      option2Input &&
      option3Input &&
      correctAnswerInput
    ) {
      const newQuestion = {
        question: questionInput,
        options: [option1Input, option2Input, option3Input],
        answer: correctAnswerInput,
      };
      setQuestions([...questions, newQuestion]);

      setQuestionInput('');
      setOption1Input('');
      setOption2Input('');
      setOption3Input('');
      setCorrectAnswerInput('');
    } else {
      alert('Please fill in all fields');
    }
  };

  const handleStartQuiz = () => {
    setShowQuiz(true);
  };


  const handleSubmitAnswer = () => {
    const currentQuestion = questions[currentQuestionIndex];
    if (currentQuestion) {
      if (userAnswer === currentQuestion.answer) {
        setScore(score + 1);
        setResultMessage('You are correct!');
        setElementColor('#c9fdd7');
      } else {
        setResultMessage(
          'Incorrect! The correct answer was: ' + currentQuestion.answer
        );
        setElementColor('#FFCCCB');
      }
      setShowResult(true);
    }
  };

  const handleNextQuestion = () => {
    setUserAnswer(''); 
    setResultMessage(''); 
    setShowResult(false); 
    setElementColor('white');

    if (currentQuestionIndex + 1 < questions.length) {
      setCurrentQuestionIndex(currentQuestionIndex + 1);
      setUserAnswer(''); 
      setElementColor('white');
    } else {
      setQuizFinished(true);
      if(score === questions.length)
      {
        setShowConfetti(true);
      }
    }
  };
  
  const handlePreviousQuestion = () => {
    if (currentQuestionIndex > 0) {
      setCurrentQuestionIndex(currentQuestionIndex - 1);
      setUserAnswer(''); 
      setResultMessage(''); 
      setShowResult(false); 
      setElementColor('white');
    }
  };

  useEffect(() => {
    if (showConfetti) {
      const timer = setTimeout(() => {
        setShowConfetti(false); 
      }, 4000);

      return () => clearTimeout(timer); 
    }
  }, [showConfetti]);
  
  const handleAnswerChange = (e) => {
    setUserAnswer(e.target.value);
  };

  const directHomePg = () => {
    window.location.href = '/flashcard-type-directing-page.html';
  }
  return (
    <div>
      <div id="header">
        <img src={logo} alt="Logo" />
        <h2>Make your Own MCQ</h2>
      </div>
      <div style={{ ...backgroundStyle, position: 'fixed', zIndex: -1 }}></div>
      <div id = "homepage">
        <button onClick={directHomePg} style = {{right: '0px', position: 'absolute'}}>⏪ Home 🏠</button>
      </div>
      <div id = "pdf">
        <button onClick = {handleButtonClick}>🔗Download PDF File</button>
        {showform ? 'Hide Form' : 'Show Form'}

        {showform && (
          <form onSubmit = {verify} id = "verify">
            <h3>Verify it's you</h3>
            <p>Enter email to download PDF</p>
            <input type = "email" value = {email} onChange = {handleInputChange} placeholder='abc@example.com'required />
            <button id = "yes" type = "submit" style = {{backgroundColor: '#07182b', color: 'white'}}>Verify</button>
            <button id = "no" onClick = {cancel} style = {{backgroundColor: '#07182b', color: 'white'}}>Cancel</button>
          </form>
        )}
      </div>
      {!showQuiz && (
        <div className="card visible">
          <h2 style = {{marginLeft: '45px'}}>Add Your MCQ Question</h2>
          <input className = "ipField" style = {{marginTop: '-40px'}}
            type="text"
            value={questionInput}
            placeholder="Enter a new question"
            onChange={(e) => setQuestionInput(e.target.value)}
          />
          <br /><br></br>
          <input className = "ipField"
            type="text"
            value={option1Input}
            placeholder="Option 1"
            onChange={(e) => setOption1Input(e.target.value)
            }
          />
          <br /><br></br>
          <input className = "ipField" style = {{marginTop: '40px'}}
            type="text"
            value={option2Input}
            placeholder="Option 2"
            onChange={(e) => setOption2Input(e.target.value)}
          />
          <br /><br></br>
          <input className = "ipField" style = {{marginTop: '80px'}}
            type="text"
            value={option3Input}
            placeholder="Option 3"
            onChange={(e) => setOption3Input(e.target.value)}
          />
          <br /><br></br>
          <input className = "ipField" style = {{marginTop: '120px'}}
            type="text"
            value={correctAnswerInput}
            placeholder="Correct Answer"
            onChange={(e) => setCorrectAnswerInput(e.target.value)}
          />
          <br /><br></br>
          <button onClick={handleAddQuestion}>Add Question</button>
          <button style = {{backgroundColor: questions.length === 0 ? 'lightSteelBlue' : '#07182b'}}
          onClick={handleStartQuiz} disabled={questions.length === 0}>
            Start Quiz
          </button>
        </div>
      )}
      {showQuiz && !quizFinished && (
        <div className="card visible" style={{ backgroundColor: elementColor }}>
          <h3 style = {{marginTop: '50px'}}>
            Question {currentQuestionIndex + 1}: {questions[currentQuestionIndex].question}
          </h3>
          {questions[currentQuestionIndex].options.map((option, index) => (
            <div key={index} style={{ display: 'flex', marginLeft:'50px', position:'relative', top: '50px', right:'30px' }}>
              <label>{option}</label>
              <input style = {{top: '0px'}}
                type="radio"
                name="options"
                value={option}
                onChange={handleAnswerChange}
                checked={userAnswer === option}
              />
            </div>
          ))}
          {showResult && (
            <div>
              <p onClick={handleSubmitAnswer} style = {{marginTop: '100px'}}
                className={resultMessage.includes('correct') ? 'correct' : 'wrong'}
              >
                {resultMessage}
              </p>
            </div>
          )}
          <br />
          <button onClick={handleSubmitAnswer} style = {{marginTop: '50px'}}>Submit Answer</button>
          <button id="prev" onClick={handlePreviousQuestion}>←</button>
          <button id="next" onClick={handleNextQuestion}>→</button>
        </div>
      )}

      {quizFinished && (
        <div className="card visible" style={{ textAlign: 'center' }}>
          <h3 style = {{bottom: '120px', left: '200px', position: 'absolute'}}>Quiz Finished! Final Score: {score}/{questions.length}</h3>
          {score === questions.length ? (
            <div>
              <p style={{ fontSize: '180px', marginTop:'20px', marginLeft: '50px' }}>🎉</p>
              {showConfetti && (
                <img
                  src={confetti}
                  alt="Confetti Celebration"
                  style={{
                    display: 'flex',
                    justifyContent: 'center',
                    alignItems: 'center',
                    width: '700px',
                    height: '500px',
                    position: 'absolute',
                    top: 0,
                    left: 0,
                    right: 0,
                    bottom: 0,
                  }}
                />
              )}
              <p style = {{bottom: '80px', left: '170px', position: 'absolute'}}>Congratulations! You got all answers correct!</p>
            </div>
          ) : (
            <div>
              <p style={{ fontSize: '180px', marginTop:'20px', marginLeft: '5px' }}>📈</p>
              <p style = {{bottom: '80px', left: '183px', position: 'absolute'}}><br/>Good effort! Try again to get all correct.</p>
            </div>
          )}
        </div>
      )}
    </div>
  );
}
export default MCQ;
